import React from 'react'
import './Tweet.css'

function Tweet() {
    return (
        <div className="tweet">
             <Avatar />
        <div className="content">
            
        <Author />
        <Message />
            
        </div>
        </div>
    )
}

export default Tweet;


function Avatar () {
    return (
        <img src="https://www.gravatar.com/avatar/nothing"
        className="avatar"
        alt="avatar" />
    )
}


function Message(){
    return(
        <div className="message">
            This is less than 140 characters.
        </div>
    )
}
function Author(){
    return(
        <div className="author">
            <span className="name">your_name</span>
            <span className="handle">@your_handle</span>
        </div>
    )
}
